    window.open('https://www.youtube.com/watch?v=_8hFkMAjW-I')
}

const UKPSButton = () => {
    return (
        <button onClick = {UKPSOnClick} className = 'module-button'>
            <AiOutlineControl size = '3em' color = 'rgb(0, 0, 0)'/>
            <h6> Personal Statements: Finding a formula </h6>
        </button>
