    window.open('https://projectaccess.org/aptitude-tests')
}

const UKAptitudeButton = () => {
    return (
        <button onClick = {UKAptitudeOnClick} className = 'module-button'>
            <BsClipboardData size = '3em' color = 'rgb(0, 0, 0)'/>
